// App.js
import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import Cabecalho from './Cabecalho'; // Importe diretamente de onde o arquivo está
import Login from './Login'; // Importe diretamente de onde o arquivo está
import './App.scss';

function App() {
  const [usuario, setUsuario] = useState(JSON.parse(sessionStorage.getItem('usuario')) || null);

  return (
    <Router>
      <div>
        <Cabecalho usuario={usuario} />
        <Switch>
          <Route
            path="/login"
            render={() => <Login setUsuario={setUsuario} />}
          />
          {/* Adicione outras rotas conforme necessário */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
